	public static int[] productExceptSelf(int[] nums) {
		 int n = nums.length;

	        int[] res = new int[n];

	        int leftVal = 1;
	        for (int i = 0; i < n; i++) {
	            res[i] = leftVal;
	            leftVal = leftVal*nums[i];
	            
	        }

	        int rightVal = 1;
	        for (int j = n - 1; j >= 0; j--) {
	            res[j] = res[j] * rightVal;
	            rightVal = rightVal * nums[j];
	            
	        }

	        return res;
	}
	
	public static int[] productExceptSelfStream(int[] nums) {
		 int n = nums.length;

	        int[] res = new int[n];

	        int leftVal = 1;
	        for (int i = 0; i < n; i++) {
	            res[i] = leftVal;
	            leftVal = leftVal*nums[i];
	            
	        }

	        int rightVal = 1;
	        for (int j = n - 1; j >= 0; j--) {
	            res[j] *= rightVal;
	            rightVal = rightVal * nums[j];
	            
	        }

	        return res;
	}

	public static int[] productExceptSelfBF(int[] nums) {
		int n = nums.length;
		
		int[] res = new int[n];
		
		int val = 1;
		for (int i = 0; i < nums.length; i++) {
			for (int j = n-1; j > -1; j--) {
				if(i!=j) {
					val = val* nums[j];
//					res[i]= Math.abs(val);
					res[i]= val;
				}
			}
			val=1;
		}
		return res;
	}
	
	public static int[] productExceptSelf7(int[] nums) {
		int n = nums.length;
		
		int[] res = new int[n];
		
		int val = 1;
		for (int i = 0; i < nums.length; i++) {
			for (int j = n-1; j > 0; j--) {
				if(i!=j) {
					val = val* nums[j];
					res[i]= Math.abs(val);
				}
			}
			val=1;
		}
		return res;
	}

